                                            <h2 _ngcontent-ng-c3751462836="" class="card-title"> About Solana </h2>
                                            <!---->
                                            <et-read-more _ngcontent-ng-c3751462836="" _nghost-ng-c3184355516=""
                                                automation-id="market-page-about-read-more-collapsed">
                                                <div _ngcontent-ng-c3184355516="" class="container"
                                                    style="max-height: 66px;"><span _ngcontent-ng-c3751462836=""
                                                        class="description">The SOL altcoin is the native token of
                                                        Solana, a public blockchain protocol that provides developers
                                                        with an efficient way to create decentralised applications. The
                                                        company is currently based in malta, and was founded by Anatoly
                                                        Yakovenko. Yakovenko published the white paper in 2017, Proof of
                                                        History (PoH), which later became a fundamental element of the
                                                        Solana network. SOL tokens launched in 2020, and can now be
                                                        traded on exchanges as well as used within the network. The
                                                        tokens can be split into fractions known as Lamports, and one
                                                        Lamport is equal to 0.0000000000582 SOL.

                                                        The SOL altcoin has two main uses within the Solana network. It
                                                        can be used to pay fees for sending transactions or running
                                                        smart contracts, but can also be used for staking, to help
                                                        secure the network. Staking can earn users inflation rewards.
                                                        SOL can also be traded on various cryptocurrency exchanges,
                                                        although as a small market cap cryptocurrency, not every
                                                        exchange will offer it.

                                                        Track the value of SOL and other cryptoassets here on
                                                        Royal Oak.</span>
